import { IconButton } from '@material-ui/core'
import React from 'react'
import '../components/css/Header.css'

function Header() {
	return (
		<header className="header">
			<IconButton>
				<PersonIcon fontSize="large" className="header-icon" />
			</IconButton>
		</header>
	)
}

export default Header
